INSERT INTO `article` VALUES (1,'我的大学生活','大学，四年的黄金时间，有的人，努力进步；有的人，迷茫踏步；有的人，浑噩睡去。而我很庆幸，我的大学生活，未曾辜负。','avatar/2020/08/timg.jpg','<p>\r\n	<img src=\"/uploads/kindeditor/2020/8/7e603f29-d71a-11ea-a585-98e7f45077a5.jpg\" alt=\"\" width=\"300\" height=\"188\" title=\"\" align=\"\" /><img src=\"/uploads/kindeditor/2020/8/7e6aa1dc-d71a-11ea-94ec-98e7f45077a5.jpg\" alt=\"\" width=\"300\" height=\"200\" title=\"\" align=\"\" /><img src=\"/uploads/kindeditor/2020/8/7e730c0b-d71a-11ea-9c6e-98e7f45077a5.jpg\" alt=\"\" width=\"300\" height=\"169\" title=\"\" align=\"\" /> \r\n</p>\r\n<p>\r\n	今天是我是上大学的第一天，真兴奋。<img src=\"http://127.0.0.1:8000/static/js/kindeditor/plugins/emoticons/images/20.gif\" border=\"0\" alt=\"\" /> \r\n</p>\r\n<p>\r\n	<img src=\"http://127.0.0.1:8000/static/js/kindeditor-4.1.5/plugins/emoticons/images/0.gif\" border=\"0\" alt=\"\" /> \r\n</p>','2020-08-03 01:14:00.225264','2020-08-03 01:14:00.225264',0,0,0,1,1,0),(2,'pycharm下python3如何安装pillow？','高版本python如何学会安装一些兼容低版本包的方法','avatar/2020/08/u16399185752085840004fm26gp0.jpg','<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	1.<strong>首先尝试pip install pillow,得到如下报错（python3.8版本无法正常安装）</strong> \r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	<img src=\"data:image/png;base64,\" alt=\"\" width=\"910\" height=\"197\" title=\"\" align=\"\" /> \r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	&nbsp;2.&nbsp;<strong>再试一下whl安装。</strong> \r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	去<a href=\"https://www.lfd.uci.edu/~gohlke/pythonlibs/#pillow\">https://www.lfd.uci.edu/~gohlke/pythonlibs/#pillow</a>&nbsp;（里面有很多python 轮子），找到对应python版本的pillow并下载（注意：内网下载很慢）。\r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	<img src=\"data:image/png;base64,\" alt=\"\" width=\"800\" height=\"56\" title=\"\" align=\"\" /> \r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	不支持。但是回想以前也是如此安装，于是继续百度。\r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	3.&nbsp;<strong>下载whl的基础上，</strong><em><strong>修改whl命名就能解决不支持平台问题</strong></em> \r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	这篇博客给了我希望&nbsp;&nbsp;<a href=\"https://blog.csdn.net/qq_33733970/article/details/80503022\">https://blog.csdn.net/qq_33733970/article/details/80503022</a> \r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	先去查询你安装的pip所支持whl命名格式。分析下载的whl文件，大致都是以&nbsp; 模块-版本号-cp38-cp38-win32.whl，我们只需要对cp38-cp38-win32部分做相应修改，再次输入pip install 轮子就能正常安装。\r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	3.1 查询pip所支持的whl命名格式\r\n</p>\r\n<pre class=\"prettyprint lang-py\"># 现在命令行进入python命令模式\r\nimport pip._internal.pep425tags \r\nprint(pip._internal.pep425tags.get_supported())</pre>\r\n<p>\r\n	<img src=\"data:image/png;base64,\" alt=\"\" width=\"910\" height=\"51\" title=\"\" align=\"\" /> \r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	<strong>这些元组内的格式都是可以支持的，必须匹配whl名字</strong>。因此把文件修改成pillow-7.2.0-cp38-none-any.whl(也可以修改成其他元组样子)，再次使用pip install 就能安装成功了。\r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<pre class=\"prettyprint lang-py\">pip install Pillow-7.2.0-cp38-none-any.whl</pre>\r\n<p>\r\n	<br />\r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	<img src=\"data:image/png;base64,\" alt=\"\" width=\"700\" height=\"127\" title=\"\" align=\"\" /> \r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	4.<strong>&nbsp;按照第三步pillow虽然安装好了，但是from PIL import Image还是会出错</strong> \r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	去<strong><span style=\"line-height:1.5;color:#FF0000;\"><a href=\"https://pypi.org/project/Pillow/7.2.0/#files\"><span style=\"line-height:1.5;color:#FF0000;\">https://pypi.org/project/Pillow/7.2.0/#files</span></a></span></strong>，发现之前下载的文件大小不正常。\r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	<img src=\"data:image/png;base64,\" alt=\"\" /> \r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	&nbsp;\r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	&nbsp;于是去pypi官方下载适合我当前python版本的，并修改文件名\r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	<img src=\"data:image/png;base64,\" alt=\"\" width=\"800\" height=\"65\" title=\"\" align=\"\" /> \r\n</p>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	再次用\r\n</p>\r\n<div class=\"cnblogs_Highlighter sh-gutter\" style=\"margin:0px;padding:0px;font-family:&quot;font-size:13px;background-color:#FFFFFF;\">\r\n	<div style=\"margin:0px;padding:0px;\">\r\n		<div id=\"highlighter_339568\" class=\"syntaxhighlighter python\" style=\"padding:0px;margin:1em 0px !important;font-size:1em !important;\">\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"border:1px solid #DFDFDF;width:705.875px;margin:0px !important;padding:0px !important;background:none !important;height:auto !important;font-family:Consolas, &quot;font-size:12px !important;\" class=\"ke-zeroborder\">\r\n				<tbody>\r\n					<tr>\r\n						<td class=\"gutter\" style=\"border:1px solid #C0C0C0;background:none !important;vertical-align:baseline !important;font-family:Consolas, &quot;color:#AFAFAF !important;\">\r\n							<div class=\"line number1 index0 alt2\" style=\"margin:0px !important;padding:0px 0.5em !important;background:none #F4F4F4 !important;text-align:right !important;vertical-align:baseline !important;\">\r\n								1\r\n							</div>\r\n						</td>\r\n						<td class=\"code\" style=\"border:1px solid #C0C0C0;background:none !important;vertical-align:baseline !important;font-family:Consolas, &quot;\">\r\n							<div class=\"container\" style=\"margin:0px !important;padding:0px !important;background:none !important;border:0px !important;vertical-align:baseline !important;\">\r\n								<div class=\"line number1 index0 alt2\" style=\"margin:0px !important;padding:0px 1em !important;background:none #F4F4F4 !important;border:0px !important;vertical-align:baseline !important;\">\r\n									pip install Pillow-7.2.0-cp38-none-win_amd64.whl\r\n								</div>\r\n							</div>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n		</div>\r\n	</div>\r\n</div>\r\n<p style=\"font-size:13px;font-family:&quot;background-color:#FFFFFF;\">\r\n	&emsp;这次安装成功后没有出错。\r\n</p>','2020-08-05 13:45:47.028731','2020-08-05 13:45:47.028731',2,0,0,2,1,0),(3,'安装mitmproxy走过的坑?','人生苦短，我用python。入门python爬虫','avatar/2020/08/timg_5Kj0Goo.jpg','<h2 style=\"font-size:21px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n	<strong> \r\n	<h2 style=\"font-size:21px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n		<strong> \r\n		<h2 style=\"font-size:21px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n			<strong> \r\n			<h2 style=\"font-size:21px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n				<strong>在安装mitmproxy包是遇到以下问题。</strong> \r\n			</h2>\r\n			<p style=\"font-size:13px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n				通过<span style=\"line-height:1.5;font-size:18pt;\"><strong>1.</strong></span><span style=\"line-height:1.5;color:#FF0000;font-size:15px;\"><strong>pip install mitmproxy</strong>&nbsp;</span>安装包时，\r\n			</p>\r\n			<p style=\"font-size:13px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n				安装如下依赖包中出错。这是安装cryptography包时缺失了模块\r\n			</p>\r\n			<p style=\"font-size:13px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n				<img src=\"data:image/png;base64,\" alt=\"\" width=\"910\" height=\"166\" title=\"\" align=\"\" /> \r\n			</p>\r\n			<p style=\"font-size:13px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n				<img src=\"https://img2020.cnblogs.com/blog/1472663/202004/1472663-20200425190017811-1162482261.png\" alt=\"\" style=\"height:auto;\" /> \r\n			</p>\r\n			<p style=\"font-size:13px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n				<span style=\"line-height:1.5;\">网上所有方法全试过了，仍然无法解决。</span><br />\r\n<span style=\"line-height:1.5;\">于是我尝试把之前修改过的全部还原。</span> \r\n			</p>\r\n			<p style=\"font-size:13px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n				<span style=\"line-height:1.5;\"><span style=\"line-height:1.5;font-size:14pt;\"><strong>解决方法</strong></span>：</span> \r\n			</p>\r\n			<p style=\"font-size:13px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n				<span style=\"line-height:1.5;\">&emsp;&emsp;</span><span style=\"line-height:1.5;\">去<span style=\"line-height:1.5;color:#FF0000;\">https://pypi.org/project/cryptography</span>找到</span> \r\n			</p>\r\n			<p style=\"font-size:13px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n				<span style=\"line-height:1.5;\">自己python对应版本下载轮子。我选择的是cryptography-2.9.2-cp38-cp38-win_amd64.whl，</span><br />\r\n<span style=\"line-height:1.5;\">最后把这个文件修改成cryptography-2.9.2-cp38-none-win_amd64.whl在执行pip install 这个whl就能安装了。</span> \r\n			</p>\r\n			<p style=\"font-size:13px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n				<span style=\"line-height:1.5;\"><strong><span style=\"line-height:1.5;font-size:18pt;\">2</span></strong>.<span style=\"line-height:1.5;color:#FF0000;font-size:15px;\"><strong>pip install&nbsp;cryptography-2.9.2-cp38-none-win_amd64.whl</strong></span></span> \r\n			</p>\r\n			<p style=\"font-size:13px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n				<span style=\"line-height:1.5;\"><span style=\"line-height:1.5;color:#FF0000;font-size:15px;\"><strong><img src=\"data:image/png;base64,\" alt=\"\" width=\"910\" height=\"42\" title=\"\" align=\"\" /><br />\r\n</strong></span></span> \r\n			</p>\r\n			<p style=\"font-size:13px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n				<em><img src=\"https://img2020.cnblogs.com/blog/1472663/202004/1472663-20200425190425453-1499645943.png\" alt=\"\" style=\"height:auto;\" /></em> \r\n			</p>\r\n			<p style=\"font-size:13px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n				<span style=\"line-height:1.5;font-size:18pt;\"><strong>3</strong><em id=\"__mceDel\">.&nbsp;</em></span><span style=\"line-height:1.5;color:#FF0000;font-size:15px;\"><strong>pip install&nbsp;pyOpenSSL</strong></span><em id=\"__mceDel\"><br />\r\n</em><span style=\"line-height:1.5;\">因为之前在安装依赖包的时候出错中断了，这时候还有一个openssl没装入，在执行pip install openssl就行了。</span><br />\r\n<span style=\"line-height:1.5;\">用<strong><span style=\"line-height:1.5;font-size:18pt;\">4</span>.&nbsp;<span style=\"line-height:1.5;color:#FF0000;font-size:15px;\">mitmweb --version</span></strong>测试,弹出版本没报错，ok</span> \r\n			</p>\r\n			<p style=\"font-size:13px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n				<span style=\"line-height:1.5;\"><img src=\"data:image/png;base64,\" alt=\"\" /><br />\r\n</span> \r\n			</p>\r\n			<p style=\"font-size:13px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n				<em><img src=\"https://img2020.cnblogs.com/blog/1472663/202004/1472663-20200425190356697-1879335331.png\" alt=\"\" style=\"height:auto;\" /></em> \r\n			</p>\r\n			<p style=\"font-size:13px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n				<strong><em id=\"__mceDel\">用国外路劲下载速度慢，推荐使用国内镜像，即：pip install -i https://tuna.tsinghua.edu.cn/simple 包名.</em></strong> \r\n			</p>\r\n</strong> \r\n		</h2>\r\n		<p style=\"font-size:13px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n			<strong><em id=\"__mceDel\"></em></strong> \r\n		</p>\r\n</strong> \r\n	</h2>\r\n	<p style=\"font-size:13px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n		<strong><em id=\"__mceDel\"></em></strong> \r\n	</p>\r\n</strong> \r\n</h2>\r\n<p style=\"font-size:13px;font-family:verdana, &quot;background-color:#FFFFFF;\">\r\n	<strong><em id=\"__mceDel\"></em></strong> \r\n</p>','2020-08-06 01:41:27.963730','2020-08-06 01:41:27.963730',2,3,0,2,1,0);
